  export function createElement(type: React.ElementType, props?: Partial<React.ComponentProps<any>>, children?: React.ReactNode): React.ReactElement<any>;
  export function forwardRef<T extends React.ElementType, P = {}>(render: (props: P & React.RefAttributes<T>) => React.ReactElement<any>): React.FC<P>;
  export function isValidElement(object: any): boolean;
  export function useCallback(callback: (...args: any[]) => any, deps?: any[]): (() => any) | undefined;
  export function useEffect(effect: React.EffectCallback, deps?: any[]): void;
  export function useMemo(factory: () => any, deps?: any[]): any;
  export function useRef(initialValue: any): React.MutableRefObject<any>;
  export function useState(initialState: any): [any, React.Dispatch<any>];
